import './App.css';
import Header from "./Components/Header";
import {Route, BrowserRouter as Router, Routes} from "react-router-dom";
import MainPage from "./Components/MainPage";

function App() {
  return (
    <Router>
        <Routes>
            <Route index element={<Header/>} />
            <Route path="/main" element={<Header/>} />

        </Routes>
    </Router>
  );
}

export default App;
